import React from 'react'
import { Button } from 'react-bootstrap'

const About = () => {
  return (
    <div>
      <Button bg='secondary' variant='secondary'>
        <a href='/'> Go Back</a>
      </Button>
      <h1>This is About</h1>
    </div>
  )
}

export default About
